syntax = "proto3";

package proto_log;

message AntiCheatLogHead {
  string time = 1;
  uint32 action_id = 2;
  string region_name = 3;
  string game_version = 4;
  uint32 uid = 5;
  uint32 level = 6;
  uint64 vip_point = 7;
  uint32 vip_level = 8;
  bool is_in_mp = 9;
  repeated uint32 mp_teammate_list = 10;
  uint32 scene_id = 11;
  uint32 tag = 12;
}
